  // },
});

export const options = axios.create({
  URL: "https://weatherapi-com.p.rapidapi.com/current.json",
  params: { q: "53.1,-0.13" },
  headers: {
    "X-RapidAPI-Key": "8a5768a865msh1ef56bc9822e1e9p18c3f1jsn4cd0d5d7952c",
